DECLARE content_clob CLOB; BEGIN content_clob := '<p>尊敬的用户欢迎您注册成为本网站会员。请用户仔细阅读以下全部内容。如用户不同意本服务条款任意内容，请不要注册或使用本网站服务。如用户通过本网站注册程序，即表示用户与本网站已达成协议，自愿接受本服务条款的所有内容。此后，用户不得以未阅读本服务条款内容作任何形式的抗辩。<br><br>一、服务条款的确认及接受<br>1、本网站各项电子服务的所有权和运作权归属于“本网站”所有，本网站提供的服务将完全按照其发布的服务条款和操作规则严格执行。您确认所有服务条款并完成注册程序时，本协议在您与本网站间成立并发生法律效力，同时您成为本网站正式会员。<br>2、根据国家法律法规变化及本网站运营需要，本网站有权对本协议条款及相关规则不时地进行修改，修改后的内容一旦以任何形式公布在本网站上即生效，并取代此前相关内容，您应不时关注本网站公告、提示信息及协议、规则等相关内容的变动。您知悉并确认，如您不同意更新后的内容，应立即停止使用本网站；如您继续使用本网站，即视为知悉变动内容并同意接受。<br><br>二、服务需知<br>1、本网站运用自身开发的操作系统通过国际互联网络为用户提供购买商品等服务。使用本网站，您必须：<br>(1)、自行配备上网的所需设备，包括个人手机、平板电脑、调制解调器、路由器等；<br>(2)、自行负担个人上网所支付的与此服务有关的电话费用、网络费用等；<br>2、基于本网站所提供的网络服务的重要性，您确认并同意：<br>(1)、提供的注册资料真实、准确、完整、合法有效，注册资料如有变动的，应及时更新；<br>(2)、如果您提供的注册资料不合法、不真实、不准确、不详尽的，您需承担因此引起的相应责任及后果，并且本网站保留终止您使用本网站各项服务的权利。<br><br>三、订单<br>1、使用本网站下订单，您应具备购买相关商品的权利能力和行为能力，如果您在18周岁以下，您需要在父母或监护人的监护参与下才能使用本网站。在下订单的同时，即视为您满足上述条件，并对您在订单中提供的所有信息的真实性负责。<br>2、在您下订单时，请您仔细确认所购商品的名称、价格、数量、型号、规格、尺寸、联系地址、电话、收货人等信息。收货人与您本人不一致的，收货人的行为和意思表示视为您的行为和意思表示，您应对收货人的行为及意思表示的法律后果承担连带责任。<br>3、您理解并同意：本网站上销售商展示的商品和价格等信息仅仅是要约邀请，您下单时须填写您希望购买的商品数量、价款及支付方式、收货人、联系方式、收货地址等内容；系统生成的订单信息是计算机信息系统根据您填写的内容自动生成的数据。<br>4、本网站会做出最大的努力，但由于市场变化及各种以合理商业努力难以控制因素的影响，本网站无法避免您提交的订单信息中的商品出现缺货情况；如您下单所购买的商品发生缺货，您有权取消订单，本网站亦有权自行取消订单，若您已经付款，则为您办理退款。<br><br>四、配送<br>1、您在本网站购买的商品将按照本网站上您所指定的送货地址进行配送。。您应当清楚准确地填写您的送货地址、联系人及联系方式等配送信息，您知悉并确认，您所购买的商品应仅由您填写的联系人接受身份查验后接收商品，因您变更联系人或相关配送信息而造成的损失由您自行承担。<br>2、因如下情况造成订单延迟或无法配送等，本网站将无法承担迟延配送的责任：<br>(1)、客户提供错误信息和不详细的地址；<br>(2)、货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果。<br>(3)、不可抗力，例如：自然灾害、交通戒严、突发战争等。<br><br>五、用户个人信息保护及授权<br>1、您知悉并同意，为方便您使用本网站相关服务，本网站将存储您在使用时的必要信息，包括但不限于您的真实姓名、性别、生日、配送地址、联系方式、通讯录、相册、日历、定位信息等。除法律法规规定的情形外，未经您的许可本网站不会向第三方公开、透露您的个人信息。<br>2、您知悉并确认，若您提供的信息不真实、不完整，则无法使用本网站或在使用过程中受到限制，同时，由此产生的不利后果，由您自行承担。<br>3、您充分理解并同意：<br>(1)、接收通过邮件、短信、电话等形式，向在本网站注册、购物的会员、收货人发送的订单信息、促销活动等内容；<br>(2)、为配合行政监管机关、司法机关执行工作，在法律规定范围内本网站有权向上述行政、司法机关提供您在使用本网站时所储存的相关信息，包括但不限于您的注册信息等，或使用相关信息进行证据保全，包括但不限于公证、见证等；<br>(3)、本网站有权根据实际情况，在法律规定范围内自行决定用户在本网站及服务中数据的最长储存期限以及用户日志