 (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('14', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '会员注册协议', '3'); END ;
DECLARE content_clob CLOB; BEGIN content_clob := '<p>1、注册/登录<br>登录商城账号，如果您还没有商城账户，请点击“注册”。<br><br>2、选购商品<br>分类浏览或直接搜索查找商品。<br><br>3、加入购物车<br>商品加入购物车去结算或者继续购物。<br><br>4、去结算<br>点击去结算按钮，进入订单信息页面，确认您的收货地址、联系方式、支付方式、配送方式、发票信息。<br><br>5、提交订单<br>确认无误，提交订单，完成支付。<br><br>6、查看订单<br>在“我的订单”页面，查看订单状态，了解商品配送流程。<br><br>7、确认收货<br>确认收货，参与商品评价互动。</p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('15', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '购物流程', '3'); END ;
