DECLARE content_clob CLOB; BEGIN content_clob := '<p>本商城会员分为5级：普通会员、银卡会员、金卡会员、白金卡会员、钻石卡会员；<br>会员权益：<br>普通会员<br>一、条件：<br>1、近一年购物金额小于等于400元<br>二、享受服务：<br>1、运费规则享受本商城运费规则，(仅限部分区域)具体运费规则参看相关说明；<br>2、积分商城里积分兑换商品；<br><br>银卡会员<br>一、条件：<br>1、近一年购物总金额大于400元小于等于1200元；<br>二、享受服务：<br>1、运费规则享受本商城运费规则，(仅限部分区域)具体运费规则参看相关说明；<br>2、积分商城里兑换积分商品；<br>3、享受不定期为银卡及以上会员策划的优惠活动；<br><br>金卡会员<br>一、条件：<br>1、近一年购物总金额大于1200元小于等于3000元；<br>二、享受服务：<br>1、运费规则享受本商城运费规则，(仅限部分区域)具体运费规则参看相关说明；<br>2、积分商城里兑换积分商品；<br>3、积分抽奖，累计运气见证奇迹的时刻；<br>4、享受商品优惠VIP价格；<br>5、享受不定期为金卡及以上会员策划的优惠活动；<br><br>白金卡会员<br>一条件：<br>1、近一年购物总金额大于3000元小于等于20000元；<br>二、享受服务：<br>1、运费规则享受本商城运费规则，(仅限部分区域)具体运费规则参看相关说明；<br>2、积分商城里兑换积分商品；<br>3、积分抽奖，累计运气见证奇迹的时刻；<br>4、享受商品优惠VIP价格；<br>5、享受不定期为白金卡及以上会员策划的优惠活动；<br>6、享受优先配送：优先金卡及以上用户配送；<br><br>钻石卡会员<br>一、条件：<br>1、近一年购物总金额大于20000元，且通过手机认证；<br>二、享受服务：<br>1、运费规则享受本商城运费规则，(仅限部分区域)具体运费规则参看相关说明；<br>2、积分商城里兑换积分商品；<br>3、积分抽奖，累计运气见证奇迹的时刻；<br>4、享受商品优惠VIP价格；<br>5、享受不定期为钻石卡会员策划的优惠活动；<br>6、享受优先配送：优先金卡及以上用户配送；<br>7、享受评价商品获赠20积分(特殊商品除外)；<br><br>特别声明：<br>1、会员升级消费额中不包括使用折扣券、礼品卡、现金券、满减券支付的部分; <br>2、会员账号禁止转借或转让他人使用，如因转借或转让他人使用所带来的一切后果，本商城概不负责，如被发现有转借或转让使用情况，本商城则有权立即取消此会员账号的相应级别资格; <br>3、会员等级只针对散客及其合理合规的善意行为。任何时候，如果我们发现账户存在或疑似存在非散客行为或非善意行为，我们有权采取降级、追回以会员等级获取的权益等措施，并保留追究责任的权利;<br>4、在我们此次更新会员制度后，您对本商城的继续使用，构成您对变更的接受;</p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('17', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '会员等级', '3'); END ;
DECLARE content_clob CLOB; BEGIN content_clob := '<p>1、忘记账户或昵称怎么办？<br>若您忘记账户或昵称，请联系客服人员为您处理。<br><br>2、如何修改登陆密码？<br>进入会员中心，进入“个人资料 - 修改密码”，根据引导即可完成密码修改。</p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('18', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '常见问题', '3'); END ;
DECLARE content_clob CLOB; BEGIN content_clob := '<p>本商城在全国大部分城市中开通了货到付款服务。<br><br>您可选择现金、POS机刷卡、支票的方式支付货款：<br>1、POS机刷卡：目前仅支持带有银联标识的银行卡，信用卡POS机刷卡消费赠送积分以各银行为准，具体信息请致电发卡行确认;<br>2、若您下单时在订单中填写POS机刷卡，支付时也可换成现金支付;<br>3、支票支付：需要您将支票内容填写完整且需要款到账后方可送货，目前仅北京、上海两地客户可使用此服务，其余区域暂不支持支票支付;<br>4、本商城快递配送时可支持现金、POS机刷卡、支票支付(仅限北京、上海两个地区);</p><p></p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('19', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '货到付款', '4'); END ;
DECLARE content_clob CLOB; BEGIN content_clob := '<p>目前商城支持多家银行网银支付，请及时使用网银支付，订单24小时内有效，逾期系统将自动取消，为保证每个顾客均有公平购买的机会，在您实际完成全部金额支付前网站不提供价格、库存保护，因工厂调价、促销结束、抢购等造成的价格、库存变化以付款时为准。<br><br>目前商城支持招商银行、中国银行、交通银行、工商银行、建设银行、农业银行、兴业银行等多家银行网银支付功能。当您提交订单之后，点击去网银支付，系统会自动转向您指定的银行支付页面。<br><br>过期系统将自动取消，请进入“我的订单”查询订单状态。如您仍需购买，请您重新下订单并支付。</p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('20', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '网银支付', '4'); END ;
DECLARE content_clob CLOB; BEGIN content_clob := '<p>一、如何开通银行卡<br>因各地银行政策不同，建议您在网上支付前拨打所在地银行电话，咨询该行可供网上支付的银行卡种类及开通手续。<br>银行名称 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 服务热线 &nbsp;&nbsp; &nbsp;<br>招商银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95555 &nbsp;&nbsp; &nbsp;<br>中国银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95566 &nbsp;&nbsp; &nbsp;<br>交通银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95559<br>北京银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 96169 &nbsp;&nbsp; &nbsp;<br>光大银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95595<br>中国邮政 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95580<br>民生银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95568 &nbsp;&nbsp; &nbsp;<br>华夏银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95577 &nbsp;&nbsp; &nbsp;<br>中信银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95558<br>中国工商银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95588<br>中国建设银行&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95533 &nbsp;&nbsp; &nbsp;<br>中国农业银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95599 &nbsp;&nbsp; &nbsp;<br>深圳发展银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95501<br>上海浦东发展银行 95528 &nbsp;&nbsp; &nbsp;<br>广东发展银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95508 <br><br>二、支付金额上限是多少？<br>目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。<br>&nbsp;<br>三、我怎样判断网上支付是否成功？<br>1、当您完成网上在线支付过程后，系统应提示支付成功；如果系统没有提示支付失败或成功，您可通过电话、ATM 、柜台或登录网上银行等各种方式查询银行卡余额，如果款项已被扣除，说明您已支付成功。<br>2、如果出现信用卡超额透支、存折余额不足、意外断线等导致支付不成功，请您登录我买网在“我的帐户”页面里“我的订单”下寻找未支付成功的订单，重新完成支付。<br>&nbsp;<br>四、造成“支付被拒绝”的原因有哪些？<br>1、所持银行卡尚未开通网上在线支付功能。<br>2、所持银行卡已过期、作废、挂失。<br>3、所持银行卡内余额不足。<br>4、输入银行卡卡号或密码不符。<br>5、输入证件号不符。<br>6、银行系统数据传输出现异常。<br>7、网络中断。</p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('21', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '银行转帐', '4'); END ;
DECLARE content_clob CLOB; BEGIN content_clob := '<p>1、商城及商家订单均不存在卡单、失效等情况。<br>2、客服人员不会通过私人手机号码、400电话和前缀带有“+”、“0”或含“()”等类型的号码，告之您订单异常，也不会引导您ATM转账、QQ提供退款链接等操作。<br>3、订单实际状态请以会员中心-我的订单页面中的交易状态为准。<br>4、商城网址是www.shopxx.net，骗子使用的诈骗链接中会刻意添加、修改商城的url地址，对于这些细微的变动，请您一定要自行辨认，谨防上当受骗。</p>'; INSERT INTO Article (id, createdDate, lastModifiedDate, version, author, content, hits, isPublication, isTop, seoDescription, seoKeywords, seoTitle, title, articleCategory_id) VALUES ('22', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', 'SHOP++', content_clob, '0', '1', '0', NULL, NULL, NULL, '账户安全', '4'); END ;
