INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('1', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '1', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 苹果公司(Apple Inc. )是美国的一家高科技公司。由史蒂夫·乔布斯、斯蒂夫·沃兹尼亚克和罗·韦恩(Ron Wayne)等人于1976年4月1日创立，并命名为美国苹果电脑公司(Apple Computer Inc. )，2007年1月9日更名为苹果公司，总部位于加利福尼亚州的库比蒂诺。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 苹果公司1980年12月12日公开招股上市，2012年创下6235亿美元的市值记录，截至2014年6月，苹果公司已经连续三年成为全球市值最大公司。苹果公司在2016年世界500强排行榜中排名第9名。2013年9月30日，在宏盟集团的“全球最佳品牌”报告中，苹果公司超过可口可乐成为世界最有价值品牌。2014年，苹果品牌超越谷歌(Google)，成为世界最具价值品牌。<br>2016年7月20日，《财富》世界500强排行榜，苹果公司名列第九名 。2016年9月8日凌晨1点，2016苹果秋季新品发布会在美国旧金山的比尔·格雷厄姆市政礼堂举行 。10月，苹果公司成为2016年全球100大最有价值品牌第一名。2017年1月6日早晨8点整，“红色星期五”促销活动在苹果官网正式上线，瞬间大量用户涌入官网进行抢购，仅两分钟所有参与活动的耳机便被抢光。2017年2月，Brand Finance发布2017年度全球500强品牌榜单，苹果公司排名第二。2017年6月7日，2017年《财富》美国500强排行榜发布，苹果公司排名第3位。2017年7月20日，2017年世界500强排名第9位。2017天猫双十一“亿元俱乐部”榜单显示，苹果位列第一名。</p>', '${demoImageUrlPrefix}/210ca72b-1ae7-4026-b76c-21463bb1722b.png', '苹果', '1', 'http://www.apple.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('2', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '2', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 北京小米科技有限责任公司成立2010年4月，是一家专注于智能硬件和电子产品研发的移动互联网公司。“为发烧而生”是小米的产品概念。小米公司创造了用互联网模式开发手机操作系统、发烧友参与开发改进的模式。小米还是继苹果、三星、华为之后第四家拥有手机芯片自研能力的科技公司。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “让每个人都能享受科技的乐趣”是小米公司的愿景。小米公司应用了互联网开发模式开发产品的模式，用极客精神做产品，用互联网模式干掉中间环节，致力让全球每个人，都能享用来自中国的优质科技产品。</p>', '${demoImageUrlPrefix}/cbc4fa6f-3a14-42c7-a554-49c8cce7c446.png', '小米', '1', 'http://www.mi.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('3', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '3', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三星集团是韩国最大的跨国企业集团，同时也是上市企业全球500强，三星集团包括众多的国际下属企业，旗下子公司有：三星电子、三星物产、三星航空、三星人寿保险等，业务涉及电子、金融、机械、化学等众多领域。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 三星集团成立于1938年，由李秉喆创办。三星集团是家族企业，李氏家族世袭，旗下各个三星产业均为家族产业，并由家族中的其他成员管理，集团领导人已传至 李氏第三代，李健熙为现任集团会长，其子李在镕任三星电子副会长。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年5月25日，华为公司在美国和中国提起对三星公司的知识产权诉讼，包括加州北区法院和深圳中级人民法院。7月21日，三星在北京知识产权法院起诉华为技术有限公司专利侵权，停止生产、销售mate8等机型，索赔8050万。9月6日，据道琼斯消息，在已出货或到达消费者手中的约250万部Note 7手机中，有70%电池为由子公司：三星SDI(SAMSUNG SDI CO.,LTD.)供应，剩下的部分则采用了中国新能源科技有限公司(ATL)的电池。10月，三星集团排2016年全球100大最有价值品牌第7名。10月，三星电子在召回Galaxy Note 7手机后又宣布停止销售该手机，几乎宣布了这款旗舰手机的“死刑”，此举或令三星损失170亿美元 。12月9日，三星准备在美国升级软件，永久禁用Galaxy Note7手机。 <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年11月4日晚间消息，三星电子美国公司宣布，将主动召回280万台特定型号的顶部开盖洗衣机。</p>', '${demoImageUrlPrefix}/d2f3d6d1-02fd-4f04-9329-f180e12885e7.png', '三星', '1', 'http://www.samsung.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('4', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '4', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 华为技术有限公司是一家生产销售通信设备的民营通信科技公司，于1987年正式注册成立，总部位于中国深圳市龙岗区坂田华为基地。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 华为是全球领先的信息与通信技术(ICT)解决方案供应商，专注于ICT领域，坚持稳健经营、持续创新、开放合作，在电信运营商、企业、终端和云计算等领域构筑了端到端的解决方案优势，为运营商客户、企业客户和消费者提供有竞争力的ICT解决方案、产品和服务，并致力于使能未来信息社会、构建更美好的全联接世界。2013年，华为首超全球第一大电信设备商爱立信，排名《财富》世界500强第315位。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 截至2016年底，华为有17万多名员工，华为的产品和解决方案已经应用于全球170多个国家，服务全球运营商50强中的45家及全球1/3的人口。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年8月，全国工商联发布“2016中国民营企业500强”榜单，华为以3950.09亿元的年营业收入成为500强榜首。8月，华为在"2016中国企业500强"中排名第27位。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月6日，《2017年BrandZ最具价值全球品牌100强》公布，华为名列第49位。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月30日，华为技术有限公司荣获中国商标金奖的马德里商标国际注册特别奖。 <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美国《财富》杂志发布了最新一期的世界500强名单 。华为以785.108亿美元营业收入首次打入前百强，排名第83位，较上一年的第129位提升46位。联想营企业500强”榜单，联想名列第四。</p>', '${demoImageUrlPrefix}/0ac3f886-754d-4a25-a0a3-195fd0ec86dd.png', '华为', '1', 'http://www.huawei.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('5', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '5', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 联想集团是1984年中国科学院计算技术研究所投资20万元人民币，由11名科技人员创办，是中国的一家在信息产业内多元化发展的大型企业集团，和富有创新性的国际化的科技公司。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 从1996年开始，联想电脑销量一直位居中国国内市场首位；2005年，联想集团收购IBM PC(Personal computer，个人电脑)事业部；2013年，联想电脑销售量升居世界第一，成为全球最大的PC生产厂商。2014年10月，联想集团宣布了该公司已经完成对摩托罗拉移动的收购。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 作为全球电脑市场的领导企业，联想从事开发、制造并销售可靠的、安全易用的技术产品及优质专业的服务，帮助全球客户和合作伙伴取得成功。联想公司主要生产台式电脑、服务器、笔记本电脑、智能电视、打印机、掌上电脑、主板、手机、一体机电脑等商品。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自2014年4月1日起， 联想集团成立了四个新的、相对独立的业务集团，分别是PC业务集团、移动业务集团、企业级业务集团、云服务业务集团。2016年8月，全国工商联发布“2016中国民营企业500强”榜单，联想名列第四。</p>', '${demoImageUrlPrefix}/a1b69d2d-4804-4881-a936-38a66819b656.png', '联想', '1', 'http://www.lenovo.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('6', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '6', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 锤子手机是由罗永浩创办的锤子科技研发的一款中高端智能手机。“锤子手机”是指由锤子科技(北京)有限公司设计与研发的一系列高端智能手机。锤子手机采用基于 Android定制的 Smartisan OS 智能手机操作系统。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年10月18日晚 19:30，锤子科技召开了2016 年秋季新品发布会，正式推出了锤子品牌的第三代手机：Smartisan M1 和 Smartisan M1L。</p>', '${demoImageUrlPrefix}/e5d7fca1-9270-4447-88cb-18b40a7090e8.png', '锤子', '1', 'http://www.smartisan.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('7', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '7', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 魅族，是智能手机厂商魅族科技有限公司的简称，成立于2003年3月；是一家国内外知名智能手机厂商，总部位于中国广东省珠海市。公司致力于向消费者提供国际一流性能和品质的电子产品，并立足于中高端市场。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 魅族手机系列成为国产智能手机创新精品，主要产品有魅族PRO6 Plus、魅族PRO6s、魅族MX6、魅族PRO6、魅族PRO5、魅族MX5、魅蓝E系列、魅蓝X、魅蓝5s、魅蓝5、魅蓝note5、魅蓝note3、魅蓝metal、魅蓝note2、魅蓝3S、魅蓝3等系列手机。魅族深谙“产品大于商业”之理念，对智能手机给出了“ J.Wong 式”的定义，追求细节，稳中求变。旗下Flyme系统是魅族设计理念在软件更深层上的体现，也是魅族手机的核心竞争力之一，被魅族称为“产品的灵魂所在”。事实上，截至目前为止，魅族 在全国一共拥有2000多家专卖店，产品在中国大陆、香港、台湾、俄罗斯、英国、法国、德国、意大利、乌克兰、以色列、捷克斯洛伐克、马来西亚、印度、印尼等国家和地区销售，魅族一直积极部署更为深入的海外市场战略。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年10月，魅族科技联合阿里巴巴在北京举行发布会，宣布双方达成战略合作。2015年2月，魅族科技获阿里巴巴5.9亿美元投资；9月，魅族新品邀请函而来的有一部GoPro产品。李楠解释选择GoPro是因为，GoPro的发音分开来看是“GO Pro”，走向PRO，PRO将是未来魅族高端子品牌的名称。根据魅族发展策略，目前魅族已拥有「魅族PRO」高端品牌、「魅族MX」中端机型以及「魅蓝」子品牌三个产品系列。</p>', '${demoImageUrlPrefix}/799568d8-29e4-4199-aa0a-53733aa1a529.png', '魅族', '1', 'http://www.meizu.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('8', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '8', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 索尼(日语：ソニー株式会社，英语：Sony Corporation)，是日本一家全球知名的大型综合性跨国企业集团。总部设于日本东京都港区港南1-7-1。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 索尼是世界视听、电子游戏、通讯产品和信息技术等领域的先导者，是世界最早便携式数码产品的开创者，是世界最大的电子产品制造商之一、世界电子游戏业三大巨头之一、美国好莱坞六大电影公司之一。其旗下品牌有Xperia，Walkman，Sony music，哥伦比亚电影公司，PlayStation等<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 曾有vaio旗下品牌，但在2014年2月6日，索尼剥离VAIO业务，Vaio品牌将由Japan Industrial Partners Inc接手运营。</p>', '${demoImageUrlPrefix}/6fb55d52-8925-4208-a05b-225b44cfbcf4.png', '索尼', '1', 'http://www.sony.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('9', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '9', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; OPPO是更多年轻人选择的拍照手机品牌。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 国产手机越来越受青睐，在中国，更多年轻人选择OPPO拍照手机。十年来，OPPO一直专注手机拍照的技术创新，开创了“手机自拍美颜”时代；全球超过2亿年轻人正在使用OPPO拍照手机。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 据权威数据机构IDC统计，OPPO 2016年已成为中国手机市场出货量第一。</p>', '${demoImageUrlPrefix}/705a01e5-1b34-435e-873b-b6c758aba1be.png', 'OPPO', '1', 'http://www.oppo.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('10', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '10', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; vivo为一个专注于智能手机领域的手机品牌，vivo和追求乐趣、充满活力、年轻时尚的群体一起打造拥有卓越外观、专业级音质、极致影像、愉悦体验的智能产品，并将敢于追求极致、持续创造惊喜作为vivo的坚定追求。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年vivo品牌的国际化之路全面开启，除中国大陆市场外，vivo进驻的海外市场包含印度、泰国、缅甸、马来西亚、印度尼西亚、越南和菲律宾。2016-2017年，vivo正式成为NBA中国官方合作伙伴。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年底，vivo高层在媒体沟通会上透露，将在国内外成立研发中心，国内部分有深圳、东莞长安、南京、杭州和北京，而在国外将在美国圣地亚哥分设研发中心。vivo将由原来的音乐和拍照的单点技术突破很可能将变成从智能手机的整体技术创新全面推进。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年5月31日，vivo在京宣布将连续成为2018年及2022年两届世界杯全球官方赞助商。借助世界杯足球赛这一顶级赛事，vivo也将进一步提升国际影响力，扎实海外布局步伐，为未来品牌出海计划做铺垫。</p>', '${demoImageUrlPrefix}/5db067fe-8341-4d40-86e2-f83418e37569.png', 'VIVO', '1', 'http://www.vivo.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('11', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '11', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 华旗资讯旗下的子品牌爱国者的英文商标。</p>', '${demoImageUrlPrefix}/bc6f521a-4427-44e3-a1f0-fb4f6cb9e381.png', '爱国者', '1', 'http://www.aigochina.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('12', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '12', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 图拉斯(TORRAS)是蓝禾集团有限公司旗下一个集研发、设计、生产、销售于一体的专业品牌。主要致力于提供完善的手机保护类产品。TORRAS团队实力强大，由拥有丰富的实践经验的创意研发团队、资深设计团队及专业采购团队等共同组成。我们拥有自己的销售通道，所以我们能够给予消费者最实惠的价格。</p>', '${demoImageUrlPrefix}/ee04687b-b557-4338-8eb5-d774c9d75e1c.png', '图斯拉', '1', 'http://www.torras.hk')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('13', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '13', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 罗马仕即深圳罗马仕科技有限公司，是一家设计、销售智能电源产品的创新型科技企业。罗马仕以独立自主的产品设计和扁平化的网络直销，向全球消费者提供可轻松拥有的高品质产品。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 罗马仕作为专业的智能电源品牌，罗马仕产品涵盖：电源、车充、适配器，三大品类；无论您在户外、室内、车内，罗马仕都能为您提供无所不能充的智能电源产品。作为超智能电源，罗马仕产品可实现对任意品牌智能手机、平板电脑、笔记本电脑充电，做到无所不能充。2013年罗马仕实现移动电源中国销售量排名第一，如今罗马仕正朝着全球第一的专业智能电源品牌迈进。</p>', '${demoImageUrlPrefix}/532363d9-72cb-48a9-9d4c-04ee52943957.png', '罗马仕', '1', 'http://www.romoss.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('14', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '14', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 深圳市绿联科技有限公司是集数码配件、充电设备等产品的自主研发、设计、生产、销售于一体的高新技术企业。公司以追求用户体验为出发点，生产出了一系列独具绿联风格的产品。产品以“UGREEN绿联”品牌背书行销大部分国家和地区，并且在亚洲和欧美市场积累了良好的口碑。</p>', '${demoImageUrlPrefix}/c1fe83c0-84fa-4831-add0-1ac63c1d7c98.png', '绿联', '1', 'http://www.lulian.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('15', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '15', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 惠普(HP)是世界最大的信息科技(IT)公司之一，成立于1939年，总部位于美国加利福尼亚州帕洛阿尔托市。惠普下设三大业务集团：信息产品集团、打印及成像系统集团和企业计算机专业服务集团。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 中国惠普有限公司总部位于北京，在上海、广州、沈阳、南京、西安、武汉、成都、深圳等都设有分公司。中国惠普在大连设有惠普全球呼叫中心，在重庆设有生产工厂，在天津设有数据中心。</p>', '${demoImageUrlPrefix}/a3689e2e-c0a0-4e61-b81e-17a9ac1bed4b.png', '惠普', '1', 'http://www.hp.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('16', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '16', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 台湾华硕电脑股份有限公司是目前全球第一大主板生产商、全球第三大显卡生产商，同时也是全球领先的3C解决方案提供商之一，致力于为个人和企业用户提供最具创新价值的产品及应用方案。华硕的产品线完整覆盖至笔记本电脑、主板、显卡、服务器、光存储、有线/无线网络通讯产品、LCD、掌上电脑、智能手机等全线3C产品。其中显卡和主板以及笔记本电脑三大产品已经成为华硕的主要竞争实力。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 遍布全球20多个国家和地区的分支机构，以及十万名员工，共同将华硕打造成年营业额超过165亿美金的信息产业巨擘。</p>', '${demoImageUrlPrefix}/6f2ba42c-3bcc-492f-83f5-0f3ec04f544b.png', '华硕', '1', 'http://www.asus.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('17', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '17', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 戴尔(Dell)，是一家总部位于美国德克萨斯州朗德罗克的世界五百强企业，由迈克尔·戴尔于1984年创立。戴尔以生产、设计、销售家用以及办公室电脑而闻名，不过它同时也涉足高端电脑市场，生产与销售服务器、数据储存设备、网络设备等。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 戴尔公司于1992年进入《财富》杂志500家之列，戴尔因此成为其中最年轻的首席执行官。戴尔公司名列《财富》杂志500家的第48位。自1995年起，戴尔公司一直名列《财富》杂志评选的“最受仰慕的公司”，2001年排名第10位。2011年上升至第6位。2017年6月7日，2017年《财富》美国500强排行榜发布，戴尔公司排名第41位 。</p>', '${demoImageUrlPrefix}/4b15da8a-77f6-41d7-9565-ecd56063a9b3.png', '戴尔', '1', 'http://www.dell.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('18', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '18', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 韩国LG集团于1947年成立于韩国首尔，位于首尔市永登浦区汝矣岛洞20号。是领导世界产业发展的国际性企业集团。LG集团目前在171个国家与地区建立了300多家海外办事机构。事业领域覆盖化学能源、电子电器、通讯与服务<br>等领域。</p>', '${demoImageUrlPrefix}/fa2b9e15-fc67-4037-ae08-ee085bdd5b9e.png', 'LG', '1', 'http://www.lg.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('19', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '19', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 先锋中国成立于2001年,是日本先锋公司在全球设立的五个地区总部之一,主要负责中国大陆、香港、台湾地区关联企业的管理及先锋产品的销售业务</p>', '${demoImageUrlPrefix}/1f3878e6-6ec8-4aee-9a9f-e86fbcd25de7.png', '先锋', '1', 'http://www.pioneerchina.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('20', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '20', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2015年7月6日，暴风科技宣布与日日顺、奥飞动漫、三诺数码影音成立合资公司，公司首款产品将为暴风TV。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年5月4日消息，暴风科技今日发布旗下超体电视2代及暴风影视VIP会员。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年9月13日，暴风TV在京举行了主题为“GiveMeFive”的新品发布会，发布了两款新品，分别为暴风TV 45X/45XS星际迷航版。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年5月10日，暴风TV在京召开发布会，发布了其第一款人工智能电视 X5 ECHO。</p>', '${demoImageUrlPrefix}/fe6fcf8b-ac8c-45a9-9d8d-24d5de38b8b4.png', '暴风TV', '1', 'http://www.bftv.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('21', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '21', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美的集团是一家领先的消费电器、暖通空调、机器人及工业自动化系统、智能供应链(物流)的科技集团。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美的集团提供多元化的产品和服务，包括以厨房家电、冰箱、洗衣机、及各类小家电的消费电器业务、以家用空调、中央空调、供暖及通风系统的暖通空调业务；以库卡集团、安川机器人合资公司等为核心的机器人及工业自动化系统业务、以安得智联为集成解决方案服务平台的智能供应链业务。美的坚守“为客户创造价值”的原则，致力创造美好生活。美的专注于持续的技术革新，以提升产品及服务质量，令生活更舒适、更美好。</p>', '${demoImageUrlPrefix}/a65279ef-4451-4584-afd9-2c732659cd08.png', '美的', '1', 'http://www.midea.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('22', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '22', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 海信拥有海信电器(600060)和海信科龙(00921)两家分别在沪、深、港三地上市的公司，持有海信(Hisense)、科龙(Kelon)和容声(Ronshen)三个中国著名商标。海信目前在全球拥有13所生产基地、12所研发中心，面向全球引进高端人才，促进国内的设计、研发人员“走出去”。海外分支机构覆盖美洲、欧洲、非洲、中东、澳洲及东南亚等全球市场，产品远销130多个国家和地区。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 继2016年成为欧洲杯顶级赞助商，海信于2017年4月6日宣布成为2018年俄罗斯世界杯官方赞助商。</p>', '${demoImageUrlPrefix}/18e35220-fe7f-45d1-9444-45c3881cd1d3.png', '海信', '1', 'http://www.hisense.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('23', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '23', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 四川长虹电子控股集团有限公司创始于1958年，公司前身国营长虹机器厂是我国“一五”期间的156项重点工程之一，是当时国内唯一的机载火控雷达生产基地。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2015年6月3日，四川长虹电器股份有限公司发出公告，称其控股股东四川长虹电子集团有限公司的公司名称已于6月3日变更为四川长虹电子控股集团有限公司(简称“长虹控股公司”)。其注册资本、经营范围也做了相应变更。2017年长虹品牌价值达1319.75亿元人民币。</p>', '${demoImageUrlPrefix}/27d33756-22d1-4ed4-8d51-4785b002f449.png', '长虹', '1', 'http://www.changhong.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('24', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '24', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 海尔集团创业于1984年，是全球大型家电品牌，目前已从传统制造家电产品的企业转型为面向全社会孵化创客的平台。在互联网时代，海尔致力于成为互联网企业，颠覆传统企业自成体系的封闭系统，变成网络互联中的节点，互联互通各种资源，打造共创共赢新平台，实现攸关各方的共赢增值。</p>', '${demoImageUrlPrefix}/7c6a1f68-8cf3-4ec0-940a-b70c83fb7351.png', '海尔', '1', 'http://www.haier.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('25', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '25', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TCL集团股份有限公司创立于1981年，是全球化的智能产品制造及互联网应用服务企业集团。集团现有8万多名员工，23个研发机构，21个制造基地，在80多个国家和地区设有销售机构，业务遍及全球160多个国家和地区。其前身为中国首批13家合资企业之一——TTK家庭电器(惠州)有限公司，从事录音磁带的生产制造，后来拓展到电话、电视、手机、冰箱、洗衣机、空调、小家电、液晶面板等领域。</p>', '${demoImageUrlPrefix}/476def94-1474-45a6-a03f-c2fddff96c60.png', 'TCL', '1', 'http://www.tcl.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('26', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '26', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 松下(Panasonic)，是日本的一个跨国性公司，在全世界设有230多家公司，员工总数超过290,493人。其中在中国有54，000多人。2001年全年的销售总额为610多亿美元，为世界制造业500强的第26名。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Panasonic的中文为“松下”(早期叫National，1986年开始逐步更改为Panasonic，2008年10月1日起全部统一为Panasonic)由日本松下电器产业株式会社自1918年松下幸之助创业，发展品牌产品涉及家电、数码视听电子、办公产品、航空等诸多领域而享誉全球；该企业品牌跃入《世界品牌500强》排行榜。</p>', '${demoImageUrlPrefix}/f5142cce-ced9-4dc6-a2e4-22b199e407ba.png', '松下', '1', 'http://www.panasonic.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('27', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '27', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 科龙集团总部位于中国广东省佛山市顺德区，1984年始生产冰箱，是中国最早生产冰箱的企业之一。继1996年发行H股并在香港挂牌上市后，1999年科龙又成功在深圳发行A股，同年更被“世界经济论坛组织”推举为1999年全球新兴市场100家最佳企业之一；2001年被《财富》杂志评选为中国上市公司百强企业。科龙一贯注重科技领先，1996年因无氟电冰箱技术获得行业内屈指可数的国家科技进步奖，2000年因碳氢物质替代CFC制造系统再获行业内同类别唯一的国家科技进步奖。至2001年，科龙已有十项冰箱核心处于国内领先地位，其中有五项更高居世界领先地位。2003年，在全球环境基金(GEF)组织举办的“节能明星冰箱”大赛中，科龙一举夺魁，获得“节能明星”大奖，标志着科龙冰箱的节能环保已达世界领先水平。</p>', '${demoImageUrlPrefix}/6471880b-e51b-40e1-a99b-309843c8e92e.png', '科龙', '1', 'http://www.kelon.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('28', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '28', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 康佳集团成立于1980年5月21日，前身是“广东光明华侨电子工业公司”，是中国改革开放后诞生的第一家中外合资电子企业，康佳集团主要从事彩色电视机、手机、白色家电、生活电器、LED、机顶盒及相关产品的研发、制造和销售，兼及精密模具、注塑件、高频头、印制板、变压器及手机电池等配套业务，是中国领先的电子信息企业。</p>', '${demoImageUrlPrefix}/f5377926-ab9d-4b75-94e2-ce3b22f74583.png', '康佳', '1', 'http://www.konka.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('29', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '29', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 飞利浦，1891年成立于荷兰，主要生产照明、家庭电器、医疗系统方面的产品。飞利浦公司，2007年全球员工已达128,100人，在全球28个国家有生产基地，在150个国家设有销售机构，拥有8万项专利，实力超群。2011年7月11日，飞利浦宣布收购奔腾电器(上海)有限公司，金额约25亿元。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2011年10月17日，飞利浦电子发布了第三季度财报，第三季度净利润同比下滑85.9%；同时宣布，飞利浦将在全球范围内裁员4500人。2013年1月底，飞利浦消费电子业务已全部剥离，将聚焦优质生活，医疗和照明设备行业。北京时间2014年12月17日，飞利浦宣布，将以12亿美元收购美国医疗设备制造商Volcano公司。</p>', '${demoImageUrlPrefix}/7f0a9957-cabb-434f-80e3-383e24e4d036.png', '飞利浦', '1', 'http://www.philips.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('30', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '30', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 宁波奥克斯空调有限公司拥有1个企业工程技术中心，3个技术研究所，1个国家级博士后工作站，有强大的空调技术研发能力和改造能力。2005年以来，奥克斯空调与韩国三星、日本松下等国际研发机构强强联手，在兼收并蓄的交流合作中，不断提升企业的创新研发实力，从而保证产品始终处于行业领先水平。目前，我们的产品涉及了30多种规格200多个内销型号。奥克斯空调坚持以“优质平价”策略做市场，市场每年保持30%以上的增长率在飞速发展的同时，空调产品平直不断提升。“奥克斯空调”通过国家节能产品认证及澳洲能耗认证，获得了国家质检首批面见产品的称号，一次性通过了国家3C强制认证，通过了ISO9001:2008版质量管理体系认证审核。连续几年被业界评为“增长速度最快品牌”称号，并获得“出口免检”、“中国名牌[有效期2007年9月-2012年9月]”、“国家免验产品”、“中国驰名商标”、“节能产品”等荣誉称号。</p>', '${demoImageUrlPrefix}/4b2e92de-986c-4c04-999c-e2c97f6d0eb1.png', '奥克斯', '1', 'http://www.auxgroup.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('31', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '31', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; lagogo，中文名“拉谷谷”。上海拉谷谷时装有限公司成立于2008年，是江苏华瑞国际集团旗下自主运营品牌。lagogo专业从事时尚女性服饰的设计、生产和销售，lagogo已拥有700多家专卖店及专柜，遍布全国大中城市。在北京、上海、广州、深圳等城市中， Lagogo已成为时尚女性所熟悉的知名品牌。</p>', '${demoImageUrlPrefix}/af869b7b-fb33-432c-9aea-2f3b68da32ae.png', '拉谷谷', '1', 'http://www.lagogo.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('32', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '32', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 南极人，成立于1997年, 是中国最早成立的内衣企业之一，首创保暖内衣产品，开创了中国内衣行业发展的新道路。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 历经18年的成长蜕变，南极人已经在内衣、母婴、服装、床品&amp;布艺、厨品、鞋品、服饰配件、户外、家电等9大品类的55大类目产品线中取得突出的成绩，签约国民好媳妇海清，共同为国人带来 “全品类消费品王国”，努力打造让用户尖叫的产品，创造极致的用户体验。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 南极人每年卖出上亿件/套的产品，为几亿人提供舒适、优质的日常生活所需。2014年双十一，南极人取得了单天1.8亿元的销售成绩，是南极人转型互联网企业后，模式创新的最强有力证明。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2016年双十一，南极人取得了5.4亿元的销售业绩，再次刷新了历史记录！</p>', '${demoImageUrlPrefix}/c392d723-5dcb-4803-99cb-94c4d280a80a.png', '南极人', '1', 'http://www.nanjiren.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('33', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '33', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ONLY是丹麦著名的国际时装公司BESTSELLER拥有的众多著名品牌之一。BESTSELLER集团成立于1975年。ONLY于1995年在丹麦创立，至今销售网点已拓展到了全球46个国家。<br>集团创立以来，已经拥有2000多家概念店和超过6000多家品牌时装零售店销售。主要市场包括丹麦、挪威、瑞典、德国、芬兰、荷兰、西班牙、法国，加拿大，英国等欧美国家。Bestseller的设计师遍布欧洲，总是站在世界潮流的前沿，为大都市的年轻人营造超级时尚概念。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ONLY在1996年来到中国，1996年9月28日，品牌诞生之初便富有远见地来到中国，从北京西单赛特的第一家店铺，到今日遍布中国大陆300多个城市共约1800家店铺。2000年对于ONLY有着品牌里程碑的意义，在这一年，ONLY首次在店铺中引进“快时尚”的定义，以保证款式始终引领潮流，这一概念流行至今并使ONLY成为众多欧洲时尚的领跑者。时尚感强的欧洲设计，让大胆而独立的都市女性通过服饰表现自我。</p>', '${demoImageUrlPrefix}/f729972b-2078-453f-9772-50eea92d549d.png', 'ONLY', '1', 'http://www.only.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('34', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '34', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 恒源祥，首个以企业身份主办有“体坛奥斯卡”之称的“劳伦斯世界体育奖颁奖盛典”的中华老字号品牌企业，同时也是中国奥委会合作伙伴、赞助商。2014年6月9日，劳伦斯学会主席埃德温·摩西正式宣布恒源祥集团成为2015劳伦斯世界体育奖主办方；2015年4月15日，劳伦斯颁奖盛典在上海大剧院盛大开幕，千余名体育界、文娱明星出席盛典。盛典当晚，恒源祥与奔驰、万国表等品牌成为了焦点，百年老字号攀上了品牌事业发展的新高峰。</p>', '${demoImageUrlPrefix}/31034318-e68c-4fbc-8274-1c3794549b45.png', '恒源祥', '1', 'http://www.hyx1927.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('35', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '35', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 拉夏贝尔(La Chapelle)品牌始创于1998年，是来自上海的经典之作。拉夏贝尔一直追求强调个性化的设计， 是将设计渗透人文文化的时尚品牌。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 拉夏贝尔设计和销售适合都市女性的流行时装和饰品，将法国浪漫、时尚、优雅的服饰文化引入到中国人的生活中。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上海拉夏贝尔服饰有限公司在国内有自营店柜近5000家，并还在增长中。LA CHAPELLE 少淑品牌，主要针对25-35岁都市办公室女性设计，线条简洁，优雅精致。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LA CHAPELLE SPORT 休闲品牌，主要针对20-30岁都市女性，健康、时尚、活力，是新一代女性追求浪漫、甜美和时尚运动的目标。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 拉夏贝尔具备法兰西的浪漫，展现女性自然、健康的生活方式。</p>', '${demoImageUrlPrefix}/0d02bf59-ca49-4dcc-864b-36d51cba410e.png', '拉夏贝尔', '1', 'http://www.lachapelle.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('36', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '36', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 朗姿，中国时尚品牌，拥有国际视野及国际影响力，致力成为成就“泛时尚生态圈”的互联网化和国家化的时尚产业集团。</p>', '${demoImageUrlPrefix}/514ab258-5435-4140-a845-daba6f2ecfba.png', '朗姿', '1', 'http://www.lancygroup.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('37', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '37', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 洛诗琳luxlead, 一个雅致的名字，职场女性(0L)时装设计。<br>&nbsp; &nbsp; &nbsp;&nbsp; luxlead洛诗琳女装以全新形象牮美登场，邀大家共同进入“衣”个色彩斑拥的世界，共赴一场华丽盛荽。洛诗琳与咨智温柔、自然时尚、优雅浪漫、热爱生活的都市女性在气质和对时尚的追求上不谋而合:我们将继续为“洛诗琳”女人设计最适合“她们”的服饰。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 洛诗琳LUXLEAD，取自Beingluxurymodel,Leading fashion trend!(奢华典范，潮流领先！)LUXLEAD是法国著名设计师Louis Austin创立的高端女装品牌。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 设计理念<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LUXLEAD立足于幸福生活的解读。巴黎优雅，塞纳河的不羁，格拉斯玫瑰的风情万种，共同将法国的时尚与浪漫演绎成流动的色彩，孕育了LUXLEAD品牌根植的生活土壤；源远流长的欧洲文明被聚拢、碾碎、消化、释放，最终浓缩为LUXLEAD品牌的设计理念，于是便诞生了最能体现女性优雅魅力的经典服饰。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; LUXLEAD将美学和潮流完美结合，针对25-40岁都是高品位女性，以优质面料、做工考究、款式典雅塑造优雅大气尊贵时尚的名媛典范。</p>', '${demoImageUrlPrefix}/930d5b80-0e91-4767-be18-23db89543545.png', '洛诗琳', '1', 'http://www.cetd.com.cn/luoshilin')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('38', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '38', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 雪中飞羽绒服是波司登国际控股有限公司旗下的品牌。雪中飞以羽绒服为基础，并最终打造为最具影响力的动感新潮休闲服装品牌。</p>', '${demoImageUrlPrefix}/54be491d-14ed-4671-bf77-481b6922bcb6.png', '雪中飞', '1', 'http://www.bosideng.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('39', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '39', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 鸭鸭集团坐落在庐山南麓，鄱阳湖畔，地理位置优越，水陆空立体交通便捷，水路有长江九江口岸，昌九高速公路、京九铁路穿境而过，相距三、四十公里的南昌、九江机场坐落两端。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “鸭鸭”牌系列产品深受我国广大消费者青睐，屡获国家、省、部优产品称号，“鸭鸭”被认定为中国驰名商标、国家重点保护品牌，“鸭鸭”牌羽绒服被评为中国名牌产品、全国免检产品。</p>', '${demoImageUrlPrefix}/7e692573-70fb-4d40-90ac-b2e3006332b4.png', '鸭鸭', '1', 'http://www.yaya.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('40', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '40', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 韩都衣舍电商集团创立于2006年，是中国最大的互联网品牌生态运营集团之一。凭借“款式多，更新快，性价比高”的产品理念，深得全国消费者的喜爱和信赖。2016年7月获批成为互联网服饰品牌第一股，股票代码838711。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2010年获“十大网货品牌”以及“最佳全球化实践网商”的称号; 2012年—2016年，在国内各大电子商务平台，连续五年行业综合排名均排第一。2014年，韩都衣舍女装取得了天猫历史上第一个全年度、双十一、双十二“三冠王 ”，男装取得天猫原创年度第一名、童装列天猫原创年度第三名。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2011年3月，获得IDG近千万美元投资。2014年9月，获得由李冰冰，黄晓明，任泉三人成立的Star VC投资，系其首个投资项目。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 通过内部孵化、合资合作及代运营等，韩都衣舍品牌集群达70个，包含女装品牌HSTYLE、男装品牌AMH、童装品牌米妮·哈鲁、妈妈装品牌迪葵纳、文艺女装品牌素缕、美国户外品牌Discovery等知名互联网品牌，包括韩风系、欧美系、东方系等主流风格，覆盖女装、男装、童装、户外等全品类。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 韩都衣舍独创的“以产品小组为核心的单品全程运营体系(IOSSP)”是企业利用互联网提升运营效率的一个成功案例，入选清华大学MBA、长江商学院、中欧国际工商学院及哈佛商学院EMBA教学案例库。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2014年4月，韩都衣舍签约韩国巨星“国民女神”全智贤，10月签约“国民弟弟”安宰贤，2015年3月，签约新生代“亚洲女神”朴信惠，10月签约韩国实力派明星池昌旭。系中国拥有国际明星代言人最多的互联网企业。</p>', '${demoImageUrlPrefix}/bb3a611b-f7b4-43bc-a924-9677776773d8.png', '韩都衣舍', '1', 'http://www.handu.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('41', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '41', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 红豆集团是江苏省重点企业集团,国务院120家大型深化改革试点企业之一，注册商标“红豆”是中国第一批驰名商标，红豆服装在全国服装行业中居领先地位。拥有总资产近30亿，2002年实现销售收入50.62亿元。2001年1月8日，红豆实业股份有限公司在上海证交所成功上市。</p>', '${demoImageUrlPrefix}/b854736e-1224-4b02-b4f3-91383fd25377.png', '红豆', '1', 'http://www.hongdou.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('42', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '42', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 七匹狼品牌创立于1990年，是中国男装行业开创性品牌。2000年推出格子茄克，成为红遍大江南北的“茄克之王”，并在此后连续16年中国茄克市场占有率第一。2004年七匹狼实业股份有限公司作为中国服装业首家公司上市(股票代码：002029)。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 作为BrandZ最具价值中国品牌一百强，七匹狼在行业内率先系统提出“男人不只一面”的服装品牌文化经营理论，形成了以品牌为核心、以生活形态产业为主导的现代企业经营体系。在立足于对博大精深的中华传统文化积极挖掘的同时，七匹狼将西方流行时尚元素融于自身设计理念，并致力于推动中国传统文化与现代时尚创意产业的契合。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “男人不只一面”，七匹狼以“品格男装”突显国际化品质和中西兼容的文化格调，以时尚传承经典，以中国面向世界。 2016年6月20日，米兰富有历史与盛名的圣巴拿巴回廊内，七匹狼2017年春夏狼文化大秀上演。这是七匹狼继2015年作为首个被米兰时装周官方邀请走秀的中国男装品牌登上米兰时装周之后，再次登上这个时尚领域的顶尖盛事。</p>', '${demoImageUrlPrefix}/cbcc9af1-6b6a-40e1-9356-b12e18543ac2.png', '七匹狼', '1', 'http://www.septwolves.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('43', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '43', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美尔雅Mailyard是湖北美尔雅股份有限公司旗下知名男装品牌，美尔雅西服是“中国十大名牌服装”、“中国十大名牌西服”，并荣获欧洲质量金奖。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在自主品牌的建设中，美尔雅别具匠心地将生产宫廷礼服的经验和工艺“嫁接”到西装生产中，760道工序、200人共同缝制做一件西服，每一件美尔雅西服都是一件艺术品。在人体体型分类上，美尔雅服饰是国内外细分程度最高的厂家，将人体体型分为瘦、正常、微胖、偏胖、肥胖、超胖6类，每一类又细分出8个大小各异的型号，在国内市场中，美尔雅还会根据各个区域消费者习惯的不同，设计精确到0.1—0.2毫米的尺寸缩放。48套版型，无论胖瘦高矮的消费者，都能够切身体会到美尔雅服装“量身定做”的体贴入微，充分体现美尔雅独特的神韵和文化内涵。</p>', '${demoImageUrlPrefix}/a2277335-e24a-44d3-b40b-e0975bf73db6.png', '美尔雅', '1', 'http://www.mailyard.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('44', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '44', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 培罗蒙西服公司创建于1928年，半个多世纪以来，以西服、大衣为代表，凭藉技术精湛，选料新颖，风格独特而闻名中外。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司全套引进日本、意大利、德国的先进设备和流水线，把现代工艺同传统工艺完善结合，与中国纺大合作的西服研究所以及共同开发的服装智能综合应用系统确保了公司服装与面料的高科技含金量。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在保持西服特色的前提下，公司又注重挖掘麾下的“春秋”、“协大祥”等老字号名牌西服、纺织面料商标的潜力，同时又涉足男士服饰的其他领域，培罗蒙T恤、内衣、标夹、衬衫、领带、皮鞋、袜品也日益为人们了解和喜爱。</p>', '${demoImageUrlPrefix}/76c167e3-6d39-4ea3-b363-5a7dd571e75d.png', '培罗蒙', '1', 'http://www.baromon.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('45', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '45', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 斯得雅(STAVA)品牌源自意大利。1992年，它诞生于意大利的托斯卡那(Tuscany)，由阿科斯帝尼(Acostyne)及其伙伴所创。成熟、高贵、典雅的品牌个性，使得斯得雅自一问世就备受青睐。经历了意大利各大时装展的风云际会之后，斯得雅逐渐广为人知，成为深受成功人士喜爱的品牌。继意大利的成功之后，斯得雅更以敏锐的眼光，稳健的步伐，在国际服装市场上迅速挺进。1993年，斯得雅开始拓展海外市场。1994年，斯得雅进入丹麦市场，受到挑剔的丹麦人的热烈欢迎。1995年进入俄罗斯、杜拜市场，业务范围从欧洲逐渐向亚洲延伸。</p>', '${demoImageUrlPrefix}/3a1e560a-5e93-42b3-ab54-67c0c0ef5765.png', '斯得雅', '1', 'http://www.stava.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('46', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '46', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 圣得西(集团)有限公司始创于1989年，公司主要从事西服、西裤、休闲上衣、茄克、T恤、休闲裤、毛衫、衬衣、皮具等男士正装和商务休闲系列化产品的开发、生产和销售，目前拥有“圣得西”、“圣奥威斯”等品牌。公司先后在巴黎、上海建立研发设计中心，引进意大利、日本、德国等国家20余条顶级生产线，聚结世界前沿的服装技术，为中国男士量身打造优雅、舒展的圣得西。历年来，圣得西以其款式新颖、面料精美、工艺精湛而著称，是目前国内高级男士正装和休闲装的代表。</p>', '${demoImageUrlPrefix}/53f52b75-77d1-401e-aa3c-89ac03cc8380.png', '圣得西', '1', 'http://www.sundance.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('47', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '47', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 阿玛尼( Armani) 是世界知名奢侈品牌，1975年由时尚设计大师乔治·阿玛尼(Giorgio Armani)创立于意大利米兰，他以使用新型面料及优良制作而闻名。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 阿玛尼品牌标志是由一只在往右看的雄鹰变形而成。</p>', '${demoImageUrlPrefix}/b5e37c1a-7086-4a86-a15d-8c721c643260.png', '阿玛尼', '1', 'http://www.armani.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('48', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '48', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 达芙妮国际控股有限公司原名为永恩国际集团有限公司，于1990年，预见于中国优质鞋类市场具庞大潜力，该集团创立自有品牌“达芙妮”，制造及销售女装鞋类，成为中国最成功之国内品牌之一。 自1996年以来连续多年获颁赠最畅销国内产品之荣衔。现时，“达芙妮”分为“D28”及“D18”两大系列，目标顾客分别为20至45岁及15至30岁之女性。达芙妮也是希腊神话中的女神，参阅月桂女神达芙妮，她是河神女儿，被阿波罗追求时被变成月桂树。另有以该词命名的时尚品牌。</p>', '${demoImageUrlPrefix}/8a37dbe5-b15b-4cfa-a1bf-fc8cde750dce.png', '达芙妮', '1', 'http://www.daphne.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('49', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '49', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 百丽集团创建于1992年3月8日，在香港丽华鞋业贸易有限公司投资大陆兴建的生产加工企业的基础上，迅速发展起来的产销一体化集团企业，中国大陆著名的鞋业品牌连锁经营公司，香港美丽宝(集团)国际控股有限公司、美国NIKE(耐克)公司、欧洲ADIDAS(阿迪达斯)公司、美国NEWBALANCE(新百伦)公司、全球鞋业最大连锁网络之一BATA(巴塔)公司以及美国李维斯公司在中国最大的合作伙伴。</p>', '${demoImageUrlPrefix}/8a7d505a-be21-4d2f-aada-3519141069d8.png', 'TATA', '1', 'http://www.tatashoes.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('50', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '50', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ECCO(爱步)，成立于1963年，是来自丹麦的鞋履品牌。产品涵盖男士系列、女士系列、休闲正装系列、户外系列、运动系列、高尔夫系列和儿童系列，同时还包括包袋配件、小皮件、鞋护产品等。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ECCO是为数不多达到资源垂直整合模式的制鞋公司之一——采用自上而下的营运模式——即从皮革原料的生产，到设计研发和产品制造，每一环节都由ECCO直接监管。迄今为止，ECCO已在全球87多个国家拥有超过14000家销售点；在中国，拥有超过1000个销售点。成立于1963年的丹麦知名家族企业，ECCO在全球各地拥有19000多名员工。ECCO也是好的皮革生产之一，其皮革不仅用于制作ECCO鞋履及皮具，也供应给多家奢侈品品牌。</p>', '${demoImageUrlPrefix}/a0745f75-b486-4f74-8ee7-d7c254807703.png', '爱步', '1', 'http://cn.ecco.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('51', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '51', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 奥康公司以制鞋为主业，并涉足商业地产、生物制品、金融投资等领域。企业年产值40多亿元，创利税6亿多元，品牌价值165.92亿元。集团实行母子公司管理体制，下辖国内外18个子公司和事业部。公司现有员工2万多人，拥有三大鞋业生产基地、五大鞋业品牌。在全国设立了30多个省级公司、3000多家连锁专卖店、800多处店中店。主导产品“奥康”牌皮鞋陆续获中国真皮领先鞋王、中国名牌产品、中国驰名商标等称号，并成为中国皮鞋行业唯一的标志性品牌。现在，集团旗下的奥康皮鞋、康龙休闲鞋、美丽佳人时尚女鞋、红火鸟鞋业都被国家质检总局评为国家免检产品。根据国家统计局公布的信息，公司连续三年位居中国工业企业行业效益十佳企业第一位。</p>', '${demoImageUrlPrefix}/ef36600f-dc09-4037-af8f-dc4c436bb807.png', '奥康', '1', 'http://www.aokang.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('52', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '52', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 意尔康(YEARCON)是意尔康股份有限公司的简称，始创于1995年，位于浙江省青田县，总裁单志敏。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1999年升格为无区域名称企业，2001年组建成企业集团，2011年完成股份制改制。总部位于浙江青田，拥有福建意尔康体育用品有限公司、意尔康鞋业(上海)有限公司和意尔康广东皮革制品有限公司三家全资子公司，在全国建有36家销售分公司和3000多家专卖店。</p>', '${demoImageUrlPrefix}/88f59c33-299b-459e-b920-fdcdde0be55d.png', '意尔康', '1', 'http://www.yearcon.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('53', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '53', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; JOSINY(卓诗尼)品牌创立于1997年，以现代时尚女性为主要消费群体，产品注重时尚与舒适的完美融合，价位适宜城市白领阶层，以国际视野萃取欧洲时尚精髓，产品时尚、个性，深受现代都市年轻女性消费者的青睐。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司2014年在国内拥有直营分公司7家，销售分公司30多家，专卖店和商场专厅2156家。 同时以商场百货、SHOPPING MALL、步行街旗舰店作为主流渠道，进入许多一、二级城市商场，并已在各个城市商业街开设专卖店，形成了品牌专卖连锁规模网络体系。 市场布局涵盖全国主流商圈、商场、步行街以及主流电子商务平台！</p>', '${demoImageUrlPrefix}/ae579765-5bbd-49dd-970a-ee2410dc2340.png', '卓诗尼', '1', 'http://www.josiny.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('54', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '54', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Hotwind热风于1996年始创于时尚之都—上海，至今已发展成为国内知名的集设计、精选和销售于一体，商品涵盖鞋品、服装、包、配饰及部分时尚生活用品的精选时尚零售连锁品牌。</p>', '${demoImageUrlPrefix}/e389e41c-15ff-4861-a2b4-76450fb48af1.png', '热风', '1', 'http://www.hotwind.net')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('55', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '55', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 成立于1980年，开始主营中高档男女皮鞋，后扩展为兼营内衣、服饰等领域，是中国鞋业的龙头企业。现有员工4000多名，占地160亩，拥有一流制鞋设备和工艺。其旗下康奈品牌中高档鞋以质量著称，以舒适时尚为产品特色 。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 目前，康奈皮鞋已在全国开设专卖店2300家，并远销世界四十几个国家和地区。从2001年1月开始，康奈在法国、美国、意大利、西班牙、比利时等欧美10多个国家开设了80多家皮鞋专卖店，成为中国皮鞋行业首家以开设专卖店形式走向国际市场的品牌。</p>', '${demoImageUrlPrefix}/ac968555-36c4-4bad-b406-fc54020ad690.png', '康奈', '1', 'http://www.kangnai.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('56', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '56', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 蜘蛛王，成立于1996年，主要经营皮鞋服饰类产品。注册资金7888万元，固定资产4.2亿元，总占地面积211亩，建筑面积16.6万平方米，曾荣获“中国名牌”、 “中国十大真皮领先鞋王”等称号。</p>', '${demoImageUrlPrefix}/f89e617a-6ce0-43b6-a307-e9685db0a1de.png', '蜘蛛王', '1', 'http://www.chinazzw.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('57', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '57', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 服饰由国际知名设计师设计，融合东西方服饰文化精华，精湛的工艺，高标准的辅料，最流行的款式，典雅的风格；涵盖西服、西裤、风衣、衬衫、T恤、休闲服等系列。</p>', '${demoImageUrlPrefix}/c89475f7-7872-4dd4-a80a-2e5288f1d864.png', '卡丹路', '1', 'http://www.cardanro.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('58', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '58', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 红蜻蜓自1995年创立以来，以其时尚的外形，亲民的价格，贴心的服务，得到了广大消费者的认可及追捧。红蜻蜓表示，未来若皮鞋行业的终端市场竞争进一步加剧，红蜻蜓不能进一步提高市场占有率，将对本公司品牌提升和业绩增长等产生不利影响2012-2014年，红蜻蜓主营业务收入分别为30.4亿元、31.9亿元和30.9亿元，同比增幅分别为4.85%。</p>', '${demoImageUrlPrefix}/e8323d01-c6e1-4a83-8ca2-68d2391634ae.png', '红蜻蜓', '1', 'http://www.cnhqt.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('59', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '59', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 回力鞋业创建于1927年，距今已有90年的历史。“回力”商标注册于1935年，1997年被认定为上海市著名商标；1999年被认定为中国驰名商标。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “回力”鞋类产品历获国家质量银质奖、化工部及上海市优质产品奖，连续数年获上海市名牌产品称号和上海市出口免检证书，并荣获第21届西班牙国际质量奖。企业通过了ISO9001：2000质量管理体系的认证。</p>', '${demoImageUrlPrefix}/92f7ae81-a707-4a0a-93b1-429e917e9c85.png', '回力', '1', 'http://www.warriorshoes.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('60', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '60', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 花花公子是世界最知名的消费品牌之一，花花公子的贵宾系列，定位于欧美高端市场，由美国花花公子企业国际有限公司(playboy Enterprises International, Inc.)创始人休?海夫纳(Hugh Hefner)一手主导推出。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 美国“花花公子”品牌从1953年诞生之初的高端品牌，逐渐走向了亲民化路线，上至名流、政要，下至普通消费者，每个人心中都有一个“花花公子”，它成为了全球最受欢迎的品牌之一。</p>', '${demoImageUrlPrefix}/bcd8f507-c7a5-4db2-9c7f-e998a9967a15.png', '花花公子贵宾', '1', 'http://www.playboy.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('61', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '61', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 百泰首饰传承大师精华，聘请多位国家级工美大师做艺术指导，工艺精湛卓越，每年推出新品上千款。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 百泰首饰品牌主张万物和合，百吉百泰，定位于中国黄金首饰行业领军者，目标是中国黄金首饰第一品牌。其竞争力体现在不断创新的工艺、精美独特的设计、精益求精的质量、热情周到的服务，核心竞争力则是品牌核心价值诉求——和合文化。和合思想的要义是：异中求同，同中存异，为和谐发展而标新立异，为坚持原则而顺心和气。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司及其自有品牌——百泰首饰在海内外赢得了良好的声誉，已获得“中国名牌”、“中国驰名商标”、“全国黄金行业先进集体”、“国家标准化良好行为AAAA级认证企业”、“广东省百强民营企业”、“深圳市民营领军骨干企业”、“深圳市高新技术企业”、“深圳市自主创新行业龙头企业”、“深圳市重点文化企业”等荣誉称号。</p>', '${demoImageUrlPrefix}/0d3f9850-9704-4710-8b1b-f29247633f9f.png', '百泰首饰', '1', 'http://www.batar.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('62', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '62', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 钻石快线珠宝网隶属于深圳市钻石快线科技发展有限公司下属子公司，是一家致力于网络产品视频影视化销售的电子商务企业，被誉为视频网购珠宝中国第一品牌。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 作为比利时钻石高阶议会(HRD和国际铂金协会(Pt在中国的唯一网络战略合作伙伴，钻石小鸟历年来联袂境内外知名设计师设计推出的钻石首饰，基于其经营模式的灵活性，钻石小鸟可在同一时间向顾客提供2万多颗不同品级的钻石以供挑选。极具特色的DIY个性定制服务满足了年轻群体的钻饰款式个性化的需求。</p>', '${demoImageUrlPrefix}/8f1e172e-0643-4453-a9d9-9232943e07e9.png', '钻石快线', '1', 'http://www.zsb2c.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('63', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '63', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上海老庙黄金有限公司的前身是“上海老城隍庙工艺品商店”，创建时间是1982年，是国务院批准国内恢复销售黄金饰品后上海开设的第一家黄金零售点。1994年12月20日，发展为专营黄金珠宝首饰的上海老城隍庙金银珠宝公司。1998年7月28日改制为上海老庙黄金有限公司。历经多年的努力，公司的注册资金已从当年的2000万元，上升到目前的11亿元。拥有资产16亿元。</p>', '${demoImageUrlPrefix}/a6e6838e-078a-40f8-a8ae-160872e777a3.png', '老庙黄金', '1', 'http://www.laomiao.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('64', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '64', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Doido是一家利用互联网信息技术优化钻石珠宝供应链，颠覆传统的钻石销售模式，为消费者提供个性化情感首饰在线定制的新型企业。总部位于中国珠宝首饰的源头—深圳罗湖珠宝产业园，由深圳市爱度珠宝有限公司与国际著名钻石公司强强联手全力打造。</p>', '${demoImageUrlPrefix}/83ebd1c2-078b-4cc8-81f0-df7dd1779b76.png', '爱度钻石', '1', 'http://www.doido.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('65', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '65', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 深圳婵娟珠宝股份有限公司(婵娟珠宝)是集珠宝产供销为一体的专业珠宝平台。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 业务涉及矿山投资、珠宝研发设计、生产加工、珠宝批发贸易、品牌商业连锁及珠宝金融投资等多个领域，拥有独特而完善的珠宝产业链发展模式。</p>', '${demoImageUrlPrefix}/c307b1ac-7a76-4b67-a554-fa63f4af0c03.png', '婵娟珠宝', '1', 'http://www.chanjuanjewelry.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('66', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '66', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 钻石小鸟创立于2002年，率先把“鼠标+水泥”的模式引入网络奢侈品领域，现已在全国14个城市设立线下体验中心。其上海旗舰体验中心在2015年1月全新升级开幕，占地2000平米，荣居全亚洲最大钻石珠宝体验中心。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 钻石小鸟始终倡导钻石文化的传播，坚持以安特卫普经典切割，一钻双证。钻石小鸟秉持“因为特别，所以闪耀”的品牌理念，倾情演绎着钻石与网络的恒久传奇。</p>', '${demoImageUrlPrefix}/845438b9-4b28-4e16-9111-962fc1c1c218.png', '钻石小鸟', '1', 'http://www.zbird.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('67', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '67', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 金立福是一家专业从事黄金、铂金、钻石加工、切割、镶嵌、产供销一条龙的大型企业，拥有设备和高技术的管理人才。建厂十多年来,曾为国内外许多知名品牌加工、镶嵌。2000年在中国大陆实行连锁经营，力争做到从源头到加盟商的一站式配货。由于款式新颖，价格合理，在同行业中始终领先一步。目前已有500多家连锁店，在全国范围内建成了以黄金、铂金、钻石连锁专营为主要销售形式、各项设施完善、服务优质的营销网络，品牌影响力不断提升。</p>', '${demoImageUrlPrefix}/99ecedca-1671-41df-9fe6-5bcfb871d5a3.png', '金立福', '1', 'http://www.jlfzb.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('68', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '68', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 周六福品牌自诞生以来，就以“缔造价值，传承真爱”作为企业使命，心怀“让每一个拥有周六福珠宝的人倍感幸福，备受尊崇”的企业发展愿景，专业从事钻石镶嵌等珠宝首饰的设计、生产、经营业务。 全国总部设立在深圳，统筹全国市场开发和专营店运营管理。周六福珠宝深耕内地市场，&nbsp; 市场网络遍及全国各地。 拥有自主独立的产品研发队伍 、规模庞大的钻石镶嵌加工厂 的周六福珠宝，凭借优质的产品、创新的设计、低成本的产品供应，让利于经销合作伙伴，因此在业内赢得“镶嵌专家”的美誉。</p>', '${demoImageUrlPrefix}/b1c0ae21-0f6d-4132-b5f7-7c3bc88f9c36.png', '周六福', '1', 'http://www.lukfook.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('69', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '69', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 佐卡伊，珠宝品牌，主要经营钻石珠宝，在北京、上海、深圳、杭州等国内主要城市设有门店，并通过品牌的官方网站及在主流B2C平台设置的旗舰店为顾客提供产品和服务。</p>', '${demoImageUrlPrefix}/b821184b-5882-42ae-973c-416f6c3480ba.png', '佐卡伊', '1', 'http://www.zocai.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('70', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '70', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I Do是一个婚戒品牌，意思为我愿意。其品牌以品质出名。赢得的广大消费者的认可，成为了奢侈品中的佼佼者。而I Do正是为满足目标消费人群的时尚、品味、前卫、品质市场需求，而量身打造。</p>', '${demoImageUrlPrefix}/6b7c7f5f-682d-4d9f-8372-77d982ac6d82.png', 'I DO', '1', 'http://www.hiersun-ido.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('71', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '71', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 古驰品牌时装一向以高档、豪华、性感而闻名于世，以“身份与财富之象征”品牌形象成为富有的上流社会的消费宠儿，一向被商界人士垂青，时尚之余不失高雅。古琦现在是意大利最大的时装集团。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 时尚潮流瞬息万变！从90年代中期以来，时尚界呼风唤雨的品牌寥寥可数，但Gucci绝对是其中最炙手可热的。Gucci与很多品牌一样，历经一段品牌低潮期之后，才逐渐回到国际主流，其实Gucci的历史发展很早，创办人Guccio Gucci早在1898年在伦敦就接触到富绅、名流，并为他们的高尚品味深深着迷。</p>', '${demoImageUrlPrefix}/0be0a4dd-e0c9-40b6-9e54-f92dfa3e5d3a.png', '古驰', '1', 'http://www.gucci.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('72', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '72', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 蔻驰，1941年诞生。总部位于纽约。COACH是美国高端生活方式时尚品牌，为男士、女士提供精致配饰与礼品，产品系列包括女士手袋、男士包款、男士及女士小皮具、鞋履、服饰、手表、旅行用品、围巾、太阳眼镜、香水、时尚首饰等。COACH的产品透过品牌精品店、指定百货公司、专门店及官方网站在全球发售。</p>', '${demoImageUrlPrefix}/0d9e3490-0758-465b-98a2-fb22a7f248a0.png', '蔻驰', '1', 'http://www.coach.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('73', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '73', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 茵曼(INMAN)，广州市汇美服装有限公司旗下棉麻生活品牌，由董事长方建华于2008年创立，凭借以“棉麻艺术家”为定位的原创设计享誉互联网，是中国成长最快、最具代表性的网络服饰零售品牌。茵曼主张“素雅而简洁，个性而不张扬”的服装设计风格，推崇原生态主题下亲近自然、回归自然的健康舒适生活，追求天人合一的衣着境界，致力于成为【属于世界的中国棉麻生活品牌】。2013年双十一女装品牌全网销量第一。 茵曼不只是销售服装，更多是为女性消费者提供环保、原生态的棉麻生活体验，回归现代都市自然“慢生活”。</p>', '${demoImageUrlPrefix}/80ab4496-44c1-4949-a52f-685634a792b2.png', '茵曼', '1', 'http://www.inman.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('74', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '74', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 普拉达(PRADA)是意大利奢侈品牌，由玛丽奥·普拉达于1913年在意大利米兰创建。Miuccia Prada的独特天赋在于对新创意的不懈追求，融合了对知识的好奇心和文化兴趣，从而开辟了先驱之路。她不仅能够预测时尚趋势，更能够引领时尚潮流。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Prada提供男女成衣、皮具、鞋履、眼镜及香水,并提供量身定制服务。</p>', '${demoImageUrlPrefix}/1a3213a6-6572-40fb-83db-89baf098dcc4.png', '普拉达', '1', 'http://www.prada.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('75', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '75', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 爱马仕(Hermès)是世界著名的奢侈品品牌，1837年由Thierry Hermès创立于法国巴黎，早年以制造高级马具起家，迄今已有180年的悠久历史。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月，《2017年BrandZ最具价值全球品牌100强》公布，爱马仕在全球排名第41位。爱马仕(Hermes)从1837年在巴黎开设首家马具店以来的180年间，就一直以精美的手工和贵族式的设计风格立足于经典服饰品牌的颠峰。它奢侈、保守、尊贵，整个品牌由整体到细节，再到它的专卖店，都弥漫着浓郁的以马文化为中心的深厚底蕴。</p>', '${demoImageUrlPrefix}/38966088-85f0-4a12-ac67-cdec4b6cb776.png', '爱马仕', '1', 'http://www.hermes.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('76', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '76', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 香奈儿(Chanel)是一个法国奢侈品品牌，创始人是Coco Chanel(原名是Gabrielle Bonheur Chanel ，中文名是加布里埃·可可·香奈儿)，该品牌于1910年在法国巴黎创立。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 该品牌产品种类繁多，有服装、珠宝饰品及其配件、化妆品、护肤品、香水等。该品牌的时装设计有高雅、简洁、精美的风格，在20世纪40年代就成功地将“五花大绑”的女装推向简单、舒适的设计。</p>', '${demoImageUrlPrefix}/699935f9-cf3e-4fdd-9cc0-cde682862647.png', '香奈儿', '1', 'http://www.chanel.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('77', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '77', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自1854年以来，代代相传至今的路易威登，以卓越品质、杰出创意和精湛工艺成为时尚旅行艺术的象征 。产品包括手提包，旅行用品，小型皮具，配饰，鞋履，成衣，腕表，高级珠宝及个性化订制服务等。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年6月6日，《2017年BrandZ最具价值全球品牌100强》公布，路易威登名列第29位。</p>', '${demoImageUrlPrefix}/0c3d1e2f-b30b-4de1-be96-0444ee2826c7.png', 'LV', '1', 'http://www.louisvuitton.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('78', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '78', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ELLE法语翻译成中文名字是“她”的意思，1945年，由Helene Lazareff在法国巴黎创立，面世后广受好评。ELLE已融入到女性生活的方方面面。以时尚导向，是女性化的、现代的、积极向上、亲切的、潮流而又充满生活气息。品牌形象：现代、朝气、优雅、活力。</p>', '${demoImageUrlPrefix}/8e3dc8be-08c9-4132-a7f0-c834752eddd2.png', 'ELLE', '1', 'http://www.elleshop.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('79', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '79', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 菲拉格慕(Ferragamo) 是意大利的女鞋王国，1927年诞生。创造力、激情和韧性是Ferragamo家族恒久不变的价值观，并代代相传。因为Salvatore Ferragamo异常关注质量和细节，他赢得了"明星御用皮鞋匠"的称号。而今，Salvatore Ferragamo是皮鞋、皮革制品、配件、服装和香氛的世界顶级的设计者之一。风格华贵典雅，实用性和款式并重，以传统手工设计和款式新颖誉满全球。</p>', '${demoImageUrlPrefix}/c41d9619-b064-430e-b7f2-4dcb0b01e408.png', 'Ferragamo', '1', 'http://www.ferragamo.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('80', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '80', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; MARUBI丸美，中国领先的护肤品企业，以卓越的眼部护理著称化妆品界，拥有全球最大最专业的眼部肌肤研究中心。在中国拥有超1000个百货公司专柜，超15000个精品加盟店，商业版图遍布全国，是国家级高新技术企业，中国驰名商标企业、中国最有价值品牌500强、全球100大美容品企业。2013年，LVMH旗下的LCapital基金战略投资丸美，进一步推动了丸美国际化品牌梦想的实现。</p>', '${demoImageUrlPrefix}/8c6ecce9-6bf9-45f7-95cb-ca819c394650.png', '丸美', '1', 'http://www.marubi.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('81', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '81', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 北京市康乃馨生物化妆品有限责任公司于1996年经国家立项建立，是国内专业生产生物技术改性明胶——酶解生物活性胶原蛋白类化妆品的高新技术企业，公司集科研、生产、贸易为一体，其所属企业分别设立在北京和杭州。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 公司产品主要原料酶解生物活性胶原蛋白是采用北京化工大学经历14年的科研成果。“水解明胶制备新技术及其制品的开发应用和推广”经北京医学院附属人民医院、上海华山医院等十大医疗单位临床应用证明了酶解生物活性胶原蛋白及其深加工制品的显著功效，此项成果荣获化工部“科技进步一等奖”，国家“科技进步二等奖”。 专注的态度和专业的眼光，以及优秀的人员配备，是康乃馨生物化妆品发展的基础，经过多年的钻研和努力，开发出与人体年轻肌肤结构十分相似的酶解生物技术活性胶原蛋白为主要原料的系列护肤产品，奏响了新世纪生物技术时代以生物仿生护肤品为主旋律的华彩乐章。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2012年，公司开始种植“中天”玫瑰，“中天”玫瑰是北京水木中天植物科学科学研究院历经十几年科研培育的具有知识产权的二次杂交新品种，该品种通过了科技部有关部门组织的科技成果鉴定和产业评估，获得4项发明专利。公司的科研人员把“中天”玫瑰这一护肤圣品加入到了紫薇的产品之中，研发出了活性胶原蛋白与玫瑰纯露相融合的绝佳护肤品，成功打入市场。其主打品牌PURPLE(紫薇)，凭借着“高品质、高品位”的定位，不断创新的精神、优秀的品质和良好的效果，赢得了消费者的好评和青睐。紫薇品牌迅速成长为中国抗衰修护类护肤品领先品牌，给国产化妆品品牌注入了新的活力，在化妆品行业中站稳了一席之地。</p>', '${demoImageUrlPrefix}/caa31634-cb8a-4cc5-ba0e-98f214b84c12.png', '紫薇', '1', 'http://www.konation.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('82', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '82', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; “百雀羚”是上海百雀羚日用化学有限公司(英文缩写：SPDC)旗下品牌，2008年曾获“中国驰名商标”称号此前“百雀羚”已连续两次获“上海市著名商标”。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 百雀羚创立于1931年，是国内屈指可数的历史悠久的著名化妆品厂商。悠久的历史，承载着光辉的业绩，成就了百雀羚品质如金的美誉。品牌曾被多次评选为“上海著名商标”，并荣获“中国驰名商标”等称号。公司先后与美国Disney、日本ASTRO BOY等国际公司合作，推出了迪士尼、阿童木等儿童护理产品系列。传承经典，勇于创新，公司致力于为消费者创造天然温和的优质护肤品，完美演绎“中国传奇，东方之美”。</p>', '${demoImageUrlPrefix}/866f5789-bad0-4107-85a9-8e1f8542e5bc.png', '百雀羚', '1', 'http://www.pechoin.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('83', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '83', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 珀莱雅是中国领先的化妆品品牌，珀莱雅发掘深海纯净、珍贵的护养成分，运用先进科技，深入肌肤本源，带来持久、由内而外的魅力。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 品牌自2006年诞生以来，深信海洋是一切生命的摇篮，也是美丽之源，珀莱雅以“深度之美，源自深海”的理念以及知性、魅力、优雅、时尚的品牌个性，为亚洲广大消费者提供全面、深入的护肤方案和美丽体验，创造了富启发性的深海护肤美学。&nbsp;&nbsp;&nbsp;&nbsp; 2015年1月12号珀莱雅荣获联合国公益大奖“年度女性发展贡献奖”。2017年11月15日，珀莱雅登陆上海证券交易所。</p>', '${demoImageUrlPrefix}/6fc9da7c-10c3-47bc-8664-ec0cb5ab1a0f.png', '珀莱雅', '1', 'http://www.proya.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('84', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '84', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 赛莱拉国际集团——全球内养外护健康美容领导者，创立于1995年，以生物科技为核心，应用于生物制药、医疗器械、检测试剂、健康食品、美容护肤品等领域。旗下拥有“赛莱拉、赛斯兰黛、康琪莱”等知名品牌，以连锁经营为主要商业模式，在全球范围内拥有数千家加盟店，为实现人们的健康美丽梦想提供优质的产品及服务。 赛莱拉集团总裁陈海佳先生，工商管理硕士，暨南大学特聘教授、研究员兼硕士生导师。2007年赴美国加州大学进修，现任全国工商联美容化妆品业商会副会长、广东省青年科学家协会常务副会长、广东生物医学工程学会副理事长，荣膺“广东省十大杰出青年”、“2012中华儿女年度人物”、“首届中国美容化妆品业十大功勋企业家”、“中华美业30年十大影响力人物”等称号。陈海佳先生敬业爱国、热心慈善，荣获了由宋庆龄基金会颁发的“爱心大使”荣誉称号，并获得了温家宝总理及西班牙萨帕特罗首相等国内外领导人接见。</p>', '${demoImageUrlPrefix}/460e564c-49c0-40fd-9720-50a4f30fac1d.png', '赛莱拉', '1', 'http://www.saliai.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('85', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '85', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 水密码是丹姿集团旗下专业补水护肤品牌；包含海洋源萃、冰川矿泉、雪颜萃、绿茶控油、红石榴新活、透肌水润这六大系列,2013年水密码正式宣布杨幂成为其品牌代言人；双方共同启动了全新海洋源萃系列的发布仪式，最新发布的水密码海洋源萃系列，定位于中高端市场，外形拥有水滴形的立体专利设计，外包装用精致梦幻的蓝色凸显高品质和科技感。</p>', '${demoImageUrlPrefix}/34dafdd0-c6fb-4727-957f-f97805327e7d.png', '水密码', '1', 'http://www.wetcode.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('86', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '86', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 温碧泉，致力于为女性提供最优质的温泉矿物护肤，承袭来自温泉的神奇美肤能量，坚持在补水领域进行不懈探索与钻研，并与中、法、韩、意等全球多个领先护肤品研究及设计机构合作，融合来自世界的科技智慧，缔造温碧泉精纯、活性的每一瓶产品。“补水就用温碧泉“为您温柔开启最纯净的肌肤青春之旅，纯享只属于您的活力自信光芒。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 随着2012年温碧泉五星品牌战略发布，更是奠定了品牌持续性发展的基石，实现品牌质的飞跃。迄今，温碧泉已发展成为国内补水保湿护肤品行业的知名品牌。温碧泉也将伴随每一位新时代的女性成就“全新”的自我！</p>', '${demoImageUrlPrefix}/9483a27d-572d-4e12-a13f-25d82dabd5c3.png', '温碧泉', '1', 'http://www.wetherm.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('87', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '87', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1872年资生堂在日本东京银座创立了第一家西式调剂药房。1897年科学性地开发出了以西洋药学处方为基础，名为红色蜜露(EUDERMINE)的化妆水。从此，资生堂便一直致力于美肌和秀发的研究，研发出了许多革新商品和美容方法。今天的资生堂不仅在日本，在世界范围内也受到众多消费者的喜爱，其产品已在全世界85个国家销售，成为亚洲第一、享誉全球的化妆品集团。</p>', '${demoImageUrlPrefix}/02ad6b1c-7d78-4fd4-820d-cd1296769331.png', '资生堂', '1', 'http://www.shiseido.com.cn')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('88', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '88', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 自然堂2001年创立于上海，已成为中国知名化妆品牌之一，在中国女性护肤品类市场占据相当大的市场份额。自然堂倡导乐享自然，美丽生活的理念，针对中国人的文化、饮食和肌肤特点研制，融合自然界天然成分与创新技术，致力于为中国消费者提供更好更专业品质的产品和服务。</p>', '${demoImageUrlPrefix}/98d50af5-5956-4cae-b20e-db7fdcff300c.png', '自然堂', '1', 'http://www.chcedo.com')
INSERT INTO Brand (id, createdDate, lastModifiedDate, version, orders, introduction, logo, name, type, url) VALUES ('89', to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), to_date('${date?string("yyyy-MM-dd HH:mm:ss")}', 'yyyy-mm-dd hh24:mi:ss'), '0', '89', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 上海相宜本草研发中心秉承“本草护肤”的理念，汇集了优秀的中药学、药理学、分析学、化学工程学、应用化学、精细化工学和包装学等不同学科专业的科研人员。上海相宜本草研发中心拥有较为完整的化妆品研发实验室，囊括原料分析实验室、配方研发实验室、工艺研发实验室、功效评价实验室和包材研发实验室等。研发开展至始至终以严谨的本草护肤功效成份筛选、现代化生产工艺、科学的配方组成、皮肤生物学测试和包材测试等阶段，实现产品的安全、有效。</p>', '${demoImageUrlPrefix}/5e80c8b7-f17c-4088-bc43-d2c79442dec2.png', '相宜本草', '1', 'http://www.inoherb.com')
